import React, { Component } from "react";

class Table extends Component {
  render() {
    const TableHeader = () => {
        return (
          <thead>
            <tr>
              <th>Name</th>
              <th>Job</th>
            </tr>
          </thead>
        )
      }
      const TableBody = () => {
        return (
          <tbody>
            <tr>
              <td>Charlie</td>
              <td>Janitor</td>
            </tr>
            <tr>
              <td>Mac</td>
              <td>Bouncer</td>
            </tr>
            <tr>
              <td>Dee</td>
              <td>Aspiring actress</td>
            </tr>
            <tr>
              <td>Dennis</td>
              <td>Bartender</td>
            </tr>
          </tbody>
        )
      }
    return (
      <table>
        <thead>
          <tr>
            <th>Student Names:</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Student Name</td>
          </tr>
        </tbody>
      </table>
    );
  }
}

export default Table;
